/* harmony default export */ __webpack_exports__["default"] = ("<div\n    class=\"container mt-4 animate__animated animate__slideInUp animate__slower\"\n    id=\"containers\"\n>\n    <h3 class=\"text-primary display-3\">\n        Coronavirus disease (COVID-19) :\n        <span class=\"h2 text-danger\">Advice for the public</span>\n    </h3>\n\n    <hr />\n    <h2 class=\"text-info\">\n        <span class=\"head-1\"\n            >Protecting yourself and others from the spread COVID-19</span\n        >\n    </h2>\n    <h4>\n        You can reduce your chances of being infected or spreading COVID-19 by\n        taking some simple precautions\n    </h4>\n    <div class=\"h5 list\">\n        <ul>\n            <li>\n                Regularly and thoroughly clean your hands with an alcohol-based\n                hand rub or wash them with soap and water. Why? Washing your\n                hands with soap and water or using alcohol-based hand rub kills\n                viruses that may be on your hands.\n            </li>\n            <li>\n                Maintain at least 1 metre (3 feet) distance between yourself and\n                others. Why? When someone coughs, sneezes, or speaks they spray\n                small liquid droplets from their nose or mouth which may contain\n                virus. If you are too close, you can breathe in the droplets,\n                including the COVID-19 virus if the person has the disease.\n            </li>\n            <li>\n                Avoid going to crowded places. Why? Where people come together\n                in crowds, you are more likely to come into close contact with\n                someone that has COIVD-19 and it is more difficult to maintain\n                physical distance of 1 metre (3 feet).\n            </li>\n            <li>\n                Avoid touching eyes, nose and mouth. Why? Hands touch many\n                surfaces and can pick up viruses. Once contaminated, hands can\n                transfer the virus to your eyes, nose or mouth. From there, the\n                virus can enter your body and infect you.\n            </li>\n            <li>\n                Make sure you, and the people around you, follow good\n                respiratory hygiene. This means covering your mouth and nose\n                with your bent elbow or tissue when you cough or sneeze. Then\n                dispose of the used tissue immediately and wash your hands. Why?\n                Droplets spread virus. By following good respiratory hygiene,\n                you protect the people around you from viruses such as cold, flu\n                and COVID-19.\n            </li>\n            <li>\n                Stay home and self-isolate even with minor symptoms such as\n                cough, headache, mild fever, until you recover. Have someone\n                bring you supplies. If you need to leave your house, wear a mask\n                to avoid infecting others. Why? Avoiding contact with others\n                will protect them from possible COVID-19 and other viruses.\n            </li>\n            <li>\n                If you have a fever, cough and difficulty breathing, seek\n                medical attention, but call by telephone in advance if possible\n                and follow the directions of your local health authority. Why?\n                National and local authorities will have the most up to date\n                information on the situation in your area. Calling in advance\n                will allow your health care provider to quickly direct you to\n                the right health facility. This will also protect you and help\n                prevent spread of viruses and other infections.\n            </li>\n        </ul>\n    </div>\n    <h2 class=\"text-info\">\n        <span class=\"head-1\">\n            Advice on the safe use of alcohol-based hand sanitizers\n        </span>\n    </h2>\n    <h4>\n        To protect yourself and others against COVID-19, clean your hands\n        frequently and thoroughly. Use alcohol-based hand sanitizer or wash your\n        hands with soap and water. If you use an alcohol-based hand sanitizer,\n        make sure you use and store it carefully.\n    </h4>\n    <div class=\"h5 list\">\n        <ul>\n            <li>\n                Keep alcohol-based hand sanitizers out of children’s reach.\n                Teach them how to apply the sanitizer and monitor its use.\n            </li>\n            <li>\n                Apply a coin-sized amount on your hands. There is no need to use\n                a large amount of the product. Avoid touching your eyes, mouth\n                and nose immediately after using an alcohol-based hand\n                sanitizer, as it can cause irritation.\n            </li>\n            <li>\n                Hand sanitizers recommended to protect against COVID-19 are\n                alcohol-based and therefore can be flammable. Do not use before\n                handling fire or cooking.\n            </li>\n            <li>\n                Under no circumstance, drink or let children swallow an\n                alcohol-based hand sanitizer. It can be poisonous.\n            </li>\n            <li>\n                Remember that washing your hands with soap and water is also\n                effective against COVID-19.\n            </li>\n        </ul>\n    </div>\n</div>\n");

